import React from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import "./content.scss"; // Importando o arquivo content.scss

export default function BulkFileXml() {
  return (
    <Box className="container">
      <Typography variant="h4" className="title" gutterBottom>
        Dentro Arrastar Arquivos
      </Typography>
      <Box className="textfield">
        <TextField
          label="Buscar XML"
          fullWidth
          variant="outlined"
          margin="normal"
          InputProps={{ classes: { root: "customInputBase" } }}
        />
      </Box>
      <Box className="buttonContainer">
        <Button variant="contained" color="primary" className="primaryButton">
          Buscar
        </Button>
        <Button variant="contained" color="primary">
          Salvar
        </Button>
      </Box>
    </Box>
  );
}
